import ChimpTest from "./ChimpTest";
import './ChimpTest.css'
import './App.css';

function App() {
  const num = 0;
  function randomize() {
    const button = document.querySelector("button");
    const randomLeftValue = Number.parseInt(Math.random() * (1000 - 10) + 10);
    const randomTopValue =  Number.parseInt(Math.random() * (1000 - 10) + 10);
    button.style.top = `${randomLeftValue}px`;
    button.style.left = `${randomTopValue}px`;
    let elem = document.getElementById('button');
    let ht = window.getComputedStyle(elem, null).getPropertyValue("top");
    console.log(ht)
  }
  return (
    <>
    <ChimpTest />
    <button>1</button>
    <button>2</button>
    <button>3</button>
    <button>4</button>
    <button>5</button>
    <button onClick= {randomize}>Start</button>
    </>
  )
}

export default App;
